import base64
import boto3
import uuid
import os
import re
from io import BytesIO
from PIL import Image
from dotenv import load_dotenv


# Load .env if present
load_dotenv()


def upload_base64_image_to_s3(
    base64_image: str,
    bucket_name: str = "amzn-placement-preparation-positron",
    folder_name: str = "hyrenet-qlibrary",
    expires: int = 604800
) -> str:
    """
    Converts a base64 image (from markdown) to PNG,
    uploads to S3, and returns a pre-signed URL.
    """

    # Read region from env (fallback safe)
    region = os.getenv("AWS_DEFAULT_REGION", "eu-north-1")

    # Remove data URL prefix if present
    if "," in base64_image:
        base64_image = base64_image.split(",", 1)[1]

    # Decode base64 â†’ bytes
    image_bytes = base64.b64decode(base64_image)

    # Load image
    image = Image.open(BytesIO(image_bytes)).convert("RGBA")

    # Generate unique filename
    filename = f"{uuid.uuid4().hex}.png"
    s3_key = f"{folder_name}/{filename}"

    # Save image to memory buffer
    buffer = BytesIO()
    image.save(buffer, format="PNG")
    buffer.seek(0)

    # Create S3 client (credentials auto-loaded from env)
    s3 = boto3.client(
        "s3",
        region_name=region,
        aws_access_key_id=os.getenv("AWS_ACCESS_KEY_ID"),
        aws_secret_access_key=os.getenv("AWS_SECRET_ACCESS_KEY"),
    )

    # Upload
    s3.put_object(
        Bucket=bucket_name,
        Key=s3_key,
        Body=image_bytes,
        ContentType="image/png",
        ACL="public-read"
    )


    img_url = f"https://{bucket_name}.s3.{region}.amazonaws.com/{s3_key}"
    return img_url


def extract_base64_images(markdown: str):
    """
    Extract base64 images from markdown.
    """
    pattern = r"!\[.*?\]\((data:image\/.*?;base64,.*?)\)"
    return re.findall(pattern, markdown)

if __name__ == '__main__':
    base_64_image ="**![](data:image/png;base64,)**"
    url = upload_base64_image_to_s3(base_64_image)
    print(url)

